import React from 'react';
import "./Book.scss"

const Book = ({ props }) => {
    return <div className="bookContainer">
        <div>
            <img src={props.imgURL} alt="bookPhoto" />
        </div>
        <div>
            <p>{props.title}</p>
            <span>{props.price}</span>
        </div>
    </div>;
};

export default Book;
